const { AccountManager, StorageType, SignerType } = require('iota-wallet')
const manager = new AccountManager({ storagePath: './storage', storageType: StorageType.Sqlite
})
const account = await manager.createAccount({ alias: 'Account1', clientOptions: { node: 'http://api.lb-0.testnet.chrysalis2.com', localPow: false }, signerType: SignerType.EnvMnemonic
})
account.sync()
